        public bool Delete(int Id)
        {
            StringBuilder strSql = new StringBuilder();
            strSql.Append("delete from feature_importance ");
            strSql.Append(" where Id=@Id");
            MySqlParameter[] parameters = {
                    new MySqlParameter("@Id", SqlDbType.Int)
            };
            parameters[0].Value = Id;

            int rows = Utility.MySqlHelper.ExecuteTxtNonQuery(strSql.ToString(), parameters);
            if (rows > 0)
            {
                return true;
            }
            else
            {
                return false;
            }
        }

        public List<feature_importance> GetAlltest()
        {
            string strSql = "select * from feature_importance where MasterID=(select MAX(MasterID) from feature_importance ) ";
            DataSet ds = Utility.MySqlHelper.ExecuteTxtDataSet(strSql);
            List<feature_importance> list = new List<feature_importance>();
            foreach (DataRow dr in ds.Tables[0].Rows)
            {
                list.Add(ConvertRowToEntity(dr));
            }
            return list;
        }

